import React from "react";
import './SpellSelector.css';

class SpellSelector extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div className="SpellSelector">
                <div className="Spell">Find Familiar</div>
                <div className="Spell">Summon Fey Spirit</div>
                <div className="Spell">Summon Lesser Demons</div>
                <div className="Spell">Summon Shadow Spirit</div>
                <div className="Spell">Conjure Minor Elemental</div>
                <div className="Spell">Summon Abberation</div>
                <div className="Spell">Summon Construct</div>
                <div className="Spell">Summon Elemental</div>
                <div className="Spell">Summon Greater Demon</div>
                <div className="Spell">Conjure Elemental</div>
                <div className="Spell">Infernal Calling</div>
                <div className="Spell">Summon Draconic Spirit</div>
                <div className="Spell">Summon Fiend</div>
            </div>
        );
    }
}

export default SpellSelector;
